// src/api/products.js
import axiosInstance from './axiosInstance';

// 전체 상품 목록 불러오기
export const fetchProducts = async () => {
  try {
    const response = await axiosInstance.get('/products');
    return response.data; // 상품 배열 반환 가정
  } catch (error) {
    console.error('상품 목록 불러오기 실패:', error);
    throw error;
  }
};
